(function() {
    'use strict';
    var moveClassNames = ['T3p4lV8L','vf0ddEkg','fzx2M_GF']
    var movelabelbyClassName = ['danmu','Im8nIjvR','cYSl9Ppa','L76SgT5E',
                                'xgplayer-shop-anchor','rtWYegYy','comment-input-container',
                                'danmakuContainer','NSZTkH_S','Hs6WJiuo',
                                'BsNa5Kmt','xgplayer-playback-setting','iaECO57F','mXmCULv9'
                            ]
    var click_classNames = ['xwxwN9YS','douyin-login__close','gT8x8FBu','p0kw7Ebs','ZmKO2juB','cThEQYeC','_CwbZHXv','bpAx2huJ']

    var noneClassNames = ['semi-button','Ex2NNAoB','xgplayer-playswitch','_CwbZHXv']

    var title = ''
    var titleClassnames = 'title'
    var upshowlistclassQuery = '.isDark .isDark .isDark'
    var loginquery = "#douyin_login_comp_flat_panel div+div";
    var is_muted = true


    window.onload = function(){



    }

    document.addEventListener("click", () => {
        move_class(moveClassNames);
    });



    var dqspurl = 'https:'
    var xhropen = XMLHttpRequest.prototype.open;
    XMLHttpRequest.prototype.open = function(method, url, async) {
        //v26-web-prime.douyinvod.com/video/tos/cn/
        //v3-web-prime.douyinvod.com/video/tos/cn/
        if(url.includes("/video/tos/cn/")){
            //console.log(url);
            const titlelist = document.getElementsByClassName(titleClassnames)
            if(titlelist.length > 0){
                title = titlelist[titlelist.length-2].innerText
            }
            update_url(url)
        }
        return xhropen.apply(this, arguments);
    };

    var _fetch = fetch
    _fetch.toString = fetch.toString;
    fetch = function(url) {
        console.log('hook:',url);
        console.log('include?',url.includes("/video/tos/cn/"));
        const urllist = url.split("&");

        if(urllist[urllist.length-1]==='download=1'){
            urllist.pop();
            arguments[0] = urllist.join("&");
            return _fetch.apply(this,arguments);
        }

        //if(!is_upshowlist()){
        //    console.log('走到这里了吗？');
        //    return _fetch.apply(this, arguments);
        //}

        if(url.includes("/video/tos/cn/")){
            console.log(url);
            const titlelist = document.getElementsByClassName(titleClassnames)
            if(titlelist.length > 0){
                title = titlelist[titlelist.length-2].innerText
            }
            update_url(url)
        }
        return _fetch.apply(this, arguments);
    };
    fetch.toString = _fetch.toString;


    var _appendChild = Node.prototype.appendChild;
    Node.prototype.appendChild = function(child) {
        if(is_muted){
            const videos = document.getElementsByTagName('video');
            if(videos.length > 0){
                for(var i = 0; i < videos.length; i++){
                    videos[i].muted = false;
                }
                is_muted = false;
            }
        }

        move_label(movelabelbyClassName);

        foreach_class(['OErEL2to'],(k,classname)=>{
            if(k.innerText!=='不感兴趣'){
                //console.log(k);
                k.remove();
            }
        })

        if(!check_type(child)){
            return _appendChild.apply(this, arguments);
        }

        //find_advertise();


        const is_classnone = noneClassNameInCreateElement(child);
        if(is_classnone){
            arguments[0] = is_classnone;
            return _appendChild.apply(this, arguments);
        }

        if(child.className.includes("jkfSVWLT")){
            appendDownloadSvg(child);
        }

        if(child.className.includes('related-video-card-login-guide__footer-close')){
            child.remove();
            var relate_ = document.getElementById('related-video-card-login-guide');
            relate_.remove();
            move_class(['vf0ddEkg'])
            return _appendChild.apply(this, arguments);
        }
        if(child.id.includes('login-full-panel')){
            child.style.display='none';
            return _appendChild.apply(this, arguments);
        }
        let fk = document.getElementById('douyin-temp-sidebar')
        if(fk){
            fk.remove();
        }

        let login = document.querySelector(loginquery);
        if(login){
            login.click();
        }

        for(var j = 0; j < click_classNames.length; j++){
            clickClassName(click_classNames[j]);
        }

        move_class(moveClassNames);
        foreach_class(['fullscreen_capture_feedback'],(k,classname)=>{
            if(k.style.paddingRight === ''){
                return;
            }
            k.style+='padding-right:0px'
        })

        return _appendChild.apply(this, arguments);
    };

    function foreach_class(classNames,target){
        for(var i = 0; i < classNames.length; i++){
            var k = document.getElementsByClassName(classNames[i]);
            if(typeof k !== 'undefined'){
                for (var j = 0; j < k.length; j++) {
                    target(k[j],classNames[i])
                }
            }
        }
    }

    function move_class(classNames){
        foreach_class(classNames,(k,className)=>{
            k.className = k.className.replace(className,"");
        })
    }

    function move_label(classNames){
        foreach_class(classNames,(k,className)=>{
            k.remove()
        })
    }


    function find_advertise(){
        const _A_tag = document.getElementsByClassName("immersive-player-switch-on-hide-interaction-area positionBox hideChangeVideo");
        let A_tag=null;
        for(let i=0;i<_A_tag.length;i++){
            let y = _A_tag[i].getBoundingClientRect().y;
            if(y<=200&&y>=-50){
                A_tag = _A_tag[i]
            }
        }
        try{
            const xgtj = A_tag.getElementsByClassName("kbRhTFR4 WbtgHYeQ")
            if(xgtj.length===0){
                var vdos = document.getElementsByClassName("xg-video-container");
                var vdo = vdos[vdos.length-1].getElementsByTagName('video')[0];
                //vdo.currentTime = vdo.duration;
            }
        }catch(e){}
        return;
    }

    function check_type(obj){
        if(typeof obj !== 'object'){
            return false;
        }
        if(typeof obj.id === 'undefined'){
            return false;
        }
        if(typeof obj.className !== 'string'){
            return false;
        }
        return true;
    }

    function clickClassName(className){
        var k = document.getElementsByClassName(className);
        for (var j = 0; j < k.length; j++) {
            k[j].click()
        }
    }

    function click_next(){
        clickClassName('xgplayer-playswitch-next')
    }

    function noneClassNameInCreateElement(child){
        const childClassname = child.className
        for(let i=0;i<noneClassNames.length;i++){
            if(childClassname.includes(noneClassNames[i])){
                child.style.display = 'none'
                return child;
            }
        }
        return false;
    }

    function appendDownloadSvg(child){
        const clasn = child;
        const divSvg = document.createElement("div");
        const svgNS = "http://www.w3.org/2000/svg";
        const svg = document.createElementNS(svgNS, "svg");
        svg.setAttribute("width", "32");
        svg.setAttribute("height", "32");
        svg.setAttribute("viewBox", "0 0 24 24");
        svg.setAttribute("fill", "none");
        svg.setAttribute("stroke", "currentColor");
        svg.setAttribute("stroke-width", "2");
        svg.setAttribute("stroke-linecap", "round");
        svg.setAttribute("stroke-linejoin", "round");
        divSvg.setAttribute("class", "feather feather-download");

        const path = document.createElementNS(svgNS, "path");
        path.setAttribute("d", "M21 15v4a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2v-4");
        svg.appendChild(path);

        const polyline = document.createElementNS(svgNS, "polyline");
        polyline.setAttribute("points", "7 10 12 15 17 10");
        svg.appendChild(polyline);

        const line = document.createElementNS(svgNS, "line");
        line.setAttribute("x1", "12");
        line.setAttribute("y1", "15");
        line.setAttribute("x2", "12");
        line.setAttribute("y2", "3");
        svg.appendChild(line);

        divSvg.appendChild(svg);
        clasn.appendChild(divSvg);

        const style = document.createElement('style');
        style.textContent = `
            .feather{
                padding: 10px;
                transition: all 0.3s ease-in-out;
                color:white;
                z-index: 9999;
            }
            .feather-download:hover {
                cursor: pointer;
            }
        `;
        divSvg.appendChild(style);
        divSvg.addEventListener('click', download_video);
    }

    function download_video(){
        if(dqspurl==='https:'){
            alert('还在解析，请等两秒再点击！');
            return;
        }
        let tit = document.getElementsByClassName(titleClassnames)
        let titstr = tit[tit.length-2].innerText
        if(titstr!==title){
            console.log(titstr)
            console.log(title)
            alert('还在解析，请等两秒再点击！');
            return;
        }
        console.log(dqspurl)
        notice('下载需要时间，请耐心等待');
        fetch(dqspurl+'&download=1')
        .then(response => response.blob())
        .then(blob => {
            const url = window.URL.createObjectURL(blob);
            const a = document.createElement('a');
            a.href = url;
            a.download = titstr+'.mp4';
            document.body.appendChild(a);
            a.click();
            window.URL.revokeObjectURL(url);
            a.remove();
        })
    }

    function qc_url(url){
        if(url==='https:'){
            return;
        }
        const urllist = url.split('&')
        urllist.pop()
        return urllist.join('&')

    }

    function update_url(url){
        if(url==='https:'){
            return;
        }
        if(qc_url(dqspurl)===qc_url('https:'+url)){
            dqspurl = 'https:'+url

        }else{
            if(url.includes('https:')){
                dqspurl = url;
                return;
            }
            dqspurl = 'https:'+url
        }
        return;
    }

    function notice(text){
        const noticeStyle = document.createElement('style');
        noticeStyle.textContent = `
        .notification {
            position: fixed;
            bottom: 20px;
            right: 20px;
            padding: 15px;
            background-color: #4CAF50;
            color: white;
            border-radius: 5px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
            opacity: 1;
            transition: opacity 1s ease-out;
            z-index: 1000;
        }
        .hide {
            opacity: 0;
        }
        `
        const noticediv = document.createElement('div');
        document.body.appendChild(noticeStyle);
        noticediv.innerText = text;
        noticediv.classList.add('notification');
        document.body.appendChild(noticediv);
        setTimeout(()=>{
            noticediv.classList.add('hide');
        },3000);
        setTimeout(()=>{
            document.body.removeChild(noticeStyle);
        },1000);
    }

    function is_upshowlist(){
        const is_upshow = document.querySelectorAll(upshowlistclassQuery);
        if(is_upshow.length===0){
            return false;
        }
        return true;
    }


})();